import Layout from './Layout';
import ReactHLS from 'react-hls-player';



const Player = () => {
    getChannel = item => {
        let myUrl = window.location.search.toString;
        let channelName = '';
        for(let i = 9; i < myUrl.length; i++) {
            channelName += myUrl[i];
        }
        return channelName;
    }

    return (
        <Layout>
            <p>{this.getChannel}</p>
        </Layout>
    )
}

export default Player;
